import React from "react";
import {FaPaperclip, FaPaperPlane, FaSmile} from "react-icons/fa";

class Entry extends React.Component{
    render(){
        return (
            <form className="flex-row-nowrap">
                <FaPaperclip style="icon"/>
                <textarea className="tinput" type="text" rows="1" placeholder="Write a message"/>               <FaSmile/>
                <FaPaperPlane/>
            </form>
        )
    }
}

export default Entry
